	(1217, 'Alla Venkata Rama Rao is an Indian inventor and chemist, known for his pioneering researches in the field of drug technology. He is the founder of the A. V. Rama Rao Research Foundation, a non governmental organization promoting research and doctoral studies in chemistry and Avra Laboratories, an organization dealing in intermediates and active pharmaceutical ingredients, used in therapeutics.@en', 15),
