	(2397, 'Nektarios N. Tavernarakis (Greek: ????????? ?. ????????????) is a bioscientist, who studies Ageing, Cell death, and Neurodegeneration. He is currently Professor of Molecular Systems Biology at the Medical School of the University of Crete, and the Director of the Institute of Molecular Biology and Biotechnology, at the Foundation for Research and Technology, in Heraklion, Crete, Greece, where he is heading the Neurogenetics and Ageing laboratory.@en', 8),
	(2398, 'Au Kin-yee (simplified Chinese: ???; traditional Chinese: ???) is a Hong Kong screenwriter.She is a long-time screenwriter for films directed by Johnnie To and/or Wai Ka-Fai of Milkyway Image and frequently works alongside writers Wai Ka-Fai, Yau Nai-Hoi and Yip Tin-Shing.@en', 8),
	(2399, 'Walter Heinrich Munk (born October 19, 1917) is an American physical oceanographer. He is professor of geophysics emeritus and holds the Secretary of the Navy/Chief of Naval Operations Oceanography Chair at Scripps Institution of Oceanography in La Jolla, California.@en', 8),
	(2400, 'Gero Miesenböck FRS is Waynflete Professor of Physiology and Director of the Centre for Neural Circuits and Behaviour (CNCB) at the University of Oxford and a fellow of Magdalen College, Oxford.@en', 8),
	(2401, 'Ralph Lawrence Brinster is an American geneticist and Richard King Mellon Professor of Reproductive Physiology at the School of Veterinary Medicine, University of Pennsylvania.@en', 8),
	(2402, 'Cheryl Reeve is an American basketball head coach, currently coaching the Minnesota Lynx of the WNBA. She is by percentage the winningest coach in WNBA history.@en', 8),
	(2403, 'Richard David Kolodner is an American scientist with Ludwig Cancer Research who has made research contributions to the genetic basis for inherited susceptibility to common cancers.@en', 8),
	(2404, 'Philip G. Killey is a retired United States Air Force officer. He attained the rank of Major General, and served as Adjutant General of the South Dakota National Guard, Director of the Air National Guard and Commander of First Air Force.@en', 8),
	(2405, 'Air Marshal Sir Patrick Henry Lyon Playfair,  (22 November 1889 – 23 November 1974) was a commander in the Royal Flying Corps during the First World War and a senior commander in the Royal Air Force until his retirement during the Second World War.In 1945 he published Warfare Today: How Modern Battles Are Planned and Fought on Land, at Sea, and in the Air, co-written by Major General J. F. C. Fuller and Admiral Sir Reginald Bacon.@en', 8),
	(2406, 'Georgy Sergeev (Russian: ???????, ??????? ????????) was a Soviet designer of artillery and rocket systems, Hero of Socialist Labor.@en', 8),
	(2407, 'Georg Gottlob FRS is an Austrian computer scientist who works in the areas of database theory, logic, and artificial intelligence and is Professor of Informatics at the University of Oxford.@en', 8),
	(2408, 'Kees Akerboom is a Dutch professional basketball player currently with the DBL team SPM Shoeters Den Bosch. Kees is the son of Kees Akerboom Sr., a former successful professional basketball player as well. In his career, Akerboom played for the Netherlands national basketball team.@en', 8),
	(2409, 'Donald H. Balch was a Brigadier General in the United States Air Force.@en', 8),
	(2410, 'John R. Ewers, Jr. is a Major General in the United States Marine Corps. He currently serves as the Staff Judge Advocate to the Commandant of the Marine Corps.@en', 8),
	(2411, 'Judy Torluemke Rankin (born February 18, 1945) is an American professional golfer and golf broadcaster. A member of the World Golf Hall of Fame, she joined the LPGA Tour in 1962 at age 17 and won 26 tour events.Rankin is currently the lead analyst for the LPGA Tour telecasts on Golf Channel, works select PGA Tour events for the network as an on-course reporter and also serves as an expert analyst for golf coverage on ESPN/ABC.@en', 8),
	(2412, 'Vinay Sapru is a feature films, Ad films, high profile corporate films director, who also runs film production company Rao & Sapru with his business partner Radhika Rao. Sapru directs movies and has a record of delivering different music videos.@en', 8),
	(2413, 'Joan Chen (or Chen Chong; born April 26, 1961) is a Chinese-American actress, film director, screenwriter, and film producer. In China she performed in the 1979 film Little Flower and came to international attention for her performance in the 1987 Academy Award-winning film The Last Emperor. She is also known for her roles in Twin Peaks, Red Rose, White Rose, Saving Face and The Home Song Stories, and for directing the feature film Xiu Xiu: The Sent Down Girl.@en', 7),
	(2414, 'Piotr Indyk is a Professor in the Theory of Computation Group at the Computer Science and Artificial Intelligence Laboratory, Massachusetts Institute of Technology.@en', 7),
	(2415, 'Larry A. Wasserman is a Canadian statistician and a professor in the Department of Statistics and the Machine Learning Department at Carnegie Mellon University.@en', 7),
	(2416, 'Major General Charles Mark Gurganus was a U.S. Marine major general who commanded Regional Command Southwest and I Marine Expeditionary Force (Forward) in Afghanistan. Prior to that, he was commander of the I Marine Expeditionary Force at Camp Pendleton, California.@en', 7),
	(2417, 'Sir Stephen Robert Bloom FRS is a Professor of Medicine at Imperial College London where he leads the Diabetes, Endocrinology and Metabolism division.@en', 7),
	(2418, 'Arthur Wong Ngok-Tai (Chinese: ???) is a nine time Hong Kong Film Awards-winning cinematographer, actor, screenwriter, film producer and film director.@en', 7),
	(2419, 'Sir Richard Timothy Hunt,  (born 19 February 1943) is a British biochemist and molecular physiologist. He was awarded the 2001 Nobel Prize in Physiology or Medicine with Paul Nurse and Leland H. Hartwell for their discoveries of protein molecules that control the division of cells. In particular, Hunt discovered what he called cyclin: a protein in fertilised sea urchin eggs which cyclically aggregates and is depleted during cell division cycles.@en', 7),
	(2420, 'Joan Chen (or Chen Chong; born April 26, 1961) is a Chinese American actress, film director, screenwriter, and film producer. In China she performed in the 1979 film Little Flower and came to international attention for her performance in the 1987 Academy Award-winning film The Last Emperor. She is also known for her roles in Twin Peaks; Red Rose, White Rose; Saving Face; and The Home Song Stories, and for directing the feature film Xiu Xiu: The Sent Down Girl.@en', 7),
	(2421, 'Ann E. Rondeau is a retired United States Navy Vice Admiral. During her tenure in the Navy, she earned four Legion of Merit awards, two Defense Distinguished Service Medals, and the Navy Distinguished Service Medal. Rondeau was the president of National Defense University and currently serves as the president of the College of DuPage.@en', 7),
