	(2442, 'Thomas Edward Lehman (born March 7, 1959) is an American professional golfer. His tournament wins include one major title, the 1996 Open Championship; and he is the only golfer in history to have been awarded the Player of the Year honor on all three PGA Tours: the regular PGA Tour, the Web.com Tour and the PGA Tour Champions.@en', 7),
	(2443, 'Oberleutnant Hans Berr was a professional soldier turned World War I flying ace credited with ten aerial victories. He was one of the German aces who pioneered the world\'s first fighter airplane, the Fokker Eindekker \\"flying gun\\".@en', 7),
