	(2448, 'John R. D\'Araujo Jr. is a retired United States Army major general who served as Director of the Army National Guard and an official with the Federal Emergency Management Agency. He is the first Filipino American to achieve the rank of major general.@en', 7),
	(2449, 'Capitaine Georges Marcel Lachmann was a French World War I flying ace. He was credited with nine confirmed aerial victories.@en', 6),
