	(2451, 'Polly A. Peyer is a retired Major General in the U.S. Air Force. She previously commanded the Warner Robins Air Logistics Center at Robins AFB in Warner Robins, Georgia.She has served as the Director of Logistics, Headquarters Pacific Air Forces, at the Hickam Air Force Base in Hawaii. In addition she served as military assistant to the acting Secretary of the Air Force.@en', 6),
	(2452, 'Lauri Allan Törni (28 May 1919 – 18 October 1965), later known as Larry Thorne, was a Finnish Army captain who led an infantry company against the Soviet Union in the Finnish Winter and Continuation Wars and moved to the United States after World War II. He fought under three flags: Finnish, German (when he again fought the Soviets in World War II), and American (where he was known as Larry Thorne) when he served in U.S. Army Special Forces in the Vietnam War.@en', 6),
