	(3748, 'The National Medal of Science is an honor bestowed by the President of the United States to individuals in science and engineering who have made important contributions to the advancement of knowledge in the fields of behavioral and social sciences, biology, chemistry, engineering, mathematics and physics. The twelve member presidential Committee on the National Medal of Science is responsible for selecting award recipients and is administered by the National Science Foundation (NSF).@en', 20),
	(3749, 'The Matteucci Medal is an Italian award for physicists, named after Carlo Matteucci. It was established to award physicists for their fundamental contributions. Under an Italian Royal Decree dated July 10, 1870, the Italian Society of Sciences was authorized to receive a donation from Carlo Matteucci for the establishment of the Prize.Matteucci MedalistsSource: Italian Society of Sciences@en', 15),
	(3750, 'The Lomonosov Gold Medal, named after Russian scientist and polymath Mikhail Lomonosov, is awarded each year since 1959 for outstanding achievements in the natural sciences and the humanities by the USSR Academy of Sciences and later the Russian Academy of Sciences (RAS). Since 1967, two medals are awarded annually: one to a Russian and one to a foreign scientist. It is the Academy\'s highest accolade.@en', 12),
	(3751, 'The Max Planck medal is the highest award of the Deutsche Physikalische Gesellschaft (English: German Physical Society), the world\'s largest organization of physicists, for extraordinary achievements in theoretical physics. The winner is awarded annually with a gold medal and hand-written parchment.@en', 11),
	(3752, 'The Faraday Medal is the top medal awarded by the Institution of Engineering and Technology (IET) (previously called the Institution of Electrical Engineers). It is part of the IET Achievement Medals collection of awards. The medal is named after the famous Michael Faraday FRS, the father of electromagnetism. Faraday is widely recognized as a top scientist, engineer, chemist, and inventor. His electromagnetic induction principles have been widely used in electric motors and generators today.@en', 9),
	(3753, 'The Stuart Ballantine Medal was a science and engineering award presented by the Franklin Institute, of Philadelphia, Pennsylvania, USA. It was named after the US inventor Stuart Ballantine.@en', 8),
	(3754, 'The Rutherford Medal and Prize is a subject award of the Institute of Physics, presented once every two years for distinguished research in nuclear physics or nuclear technology.@en', 3),
	(3755, 'REDIRECT USSR State Prize@en', 2),
	(3756, 'The Carbon Medal is a medal of achievement in Carbon Science and Technology given by the American Carbon Society for the \\"... outstanding contributions to the discovery of novel carbon products or processes.\\"@en', 2),
