	(4438, 'The Nobel Prize in Physics (Swedish: Nobelpriset i fysik) is a yearly award given by the Royal Swedish Academy of Sciences for those who conferred the most outstanding contributions for mankind in the field of physics.@en', 156),
	(4439, 'The National Medal of Science is an honor bestowed by the President of the United States to individuals in science and engineering who have made important contributions to the advancement of knowledge in the fields of behavioral and social sciences, biology, chemistry, engineering, mathematics and physics. The twelve member presidential Committee on the National Medal of Science is responsible for selecting award recipients and is administered by the National Science Foundation (NSF).@en', 20),
	(4440, 'The Matteucci Medal is an Italian award for physicists, named after Carlo Matteucci. It was established to award physicists for their fundamental contributions. Under an Italian Royal Decree dated July 10, 1870, the Italian Society of Sciences was authorized to receive a donation from Carlo Matteucci for the establishment of the Prize.Matteucci MedalistsSource: Italian Society of Sciences@en', 15),
	(4441, 'The Copley Medal is a scientific award given by the Royal Society, for \\"outstanding achievements in research in any branch of science.\\" It alternates between the physical and the biological sciences.@en', 13),
	(4442, 'The Lomonosov Gold Medal, named after Russian scientist and polymath Mikhail Lomonosov, is awarded each year since 1959 for outstanding achievements in the natural sciences and the humanities by the USSR Academy of Sciences and later the Russian Academy of Sciences (RAS). Since 1967, two medals are awarded annually: one to a Russian and one to a foreign scientist. It is the Academy\'s highest accolade.@en', 12),
	(4443, 'The Max Planck medal is the highest award of the Deutsche Physikalische Gesellschaft (English: German Physical Society), the world\'s largest organization of physicists, for extraordinary achievements in theoretical physics. The winner is awarded annually with a gold medal and hand-written parchment.@en', 11),
	(4444, 'The Faraday Medal is the top medal awarded by the Institution of Engineering and Technology (IET) (previously called the Institution of Electrical Engineers). It is part of the IET Achievement Medals collection of awards. The medal is named after the famous Michael Faraday FRS, the father of electromagnetism. Faraday is widely recognized as a top scientist, engineer, chemist, and inventor. His electromagnetic induction principles have been widely used in electric motors and generators today.@en', 9),
	(4445, 'The Stuart Ballantine Medal was a science and engineering award presented by the Franklin Institute, of Philadelphia, Pennsylvania, USA. It was named after the US inventor Stuart Ballantine.@en', 8),
	(4446, 'The Rutherford Medal and Prize is a subject award of the Institute of Physics, presented once every two years for distinguished research in nuclear physics or nuclear technology.@en', 3),
	(4447, 'The Young Medal and Prize is a prize awarded on odd numbered years by the Institute of Physics in the memory of Thomas Young for distinguished research in the field of optics, including physics outside the visible region.@en', 3),
	(4448, 'The Gold Medal of the Royal Astronomical Society (RAS) is the highest award given by the RAS. The RAS Council have \\"complete freedom as to the grounds on which it is awarded\\" and as such it can be awarded for any reason.@en', 2),
	(4449, 'The Kyoto Prize (???, Ky?to-sh?) is Japan\'s highest private award for global achievement. The Kyoto Prize is given not only to those that are top representatives of their own respective field, but also to those that have contributed to humanity with their work. The Kyoto Prizes are regarded by many as the most prestigious award available in fields that are traditionally not honored with a Nobel Prize.@en', 2),
