	(5878, 'Ranjitram Suvarna Chandrak, also known as the Ranjitram Gold Medal, was founded by Gujarat Sahitya Sabha and is considered the highest literary award in Gujarati literature. The award is named after renowned Gujarati writer Ranjitram Mehta.@en', 1),
	(5879, 'Singer-songwriter Bob Dylan has been honored with many accolades throughout his career in show business, which has lasted for six decades.@en', 1),
	(5880, 'The Lomonosov Gold Medal, named after Russian scientist and polymath Mikhail Lomonosov, is awarded each year since 1959 for outstanding achievements in the natural sciences and the humanities by the USSR Academy of Sciences and later the Russian Academy of Sciences (RAS). Since 1967, two medals are awarded annually: one to a Russian and one to a foreign scientist. It is the Academy\'s highest accolade.@en', 1),
