	(6789, 'Jenniffer Aydin González Colón (born August 5, 1976) is a politician and Republican that has occupied numerous leadership positions in the New Progressive Party (PNP in Spanish) and that is the current Chairwoman of the Puerto Rico Republican Party. Today, González serves in three prominent roles: as Minority Leader of the House of Representatives of Puerto Rico, as vice-chair of the PNP, and as the chair of the Puerto Rico Republican Party.@en', 10),
