	(7509, 'Du Xi, courtesy name Zixu (??), was a military general serving under the warlord Cao Cao in the late Eastern Han Dynasty. He was a subordinate of Cao\'s general Xiahou Yuan. Du proposed to the troops that Zhang He take command after Xiahou Yuan was killed at the Battle of Mount Dingjun.@en', 8),
