	(7512, 'Curtius Rufus () was a Roman professional magistrate of senatorial rank mentioned by Tacitus and Pliny the Younger for life events occurring during the reigns of the emperors Tiberius and Claudius. In all probability he is to be equated with the first-century Roman historian Quintus Curtius Rufus.@en', 6),
	(7513, 'John S. Case was a Republican politician from Maine who served as the Mayor of Rockland, Maine, and as a member of the Maine House of Representatives.@en', 6),
	(7514, 'Chen Biao (birth and death dates unknown), courtesy name Wen\'ao, was an official and military general of the state of Eastern Wu in the Three Kingdoms period.@en', 6),
	(7515, 'Liao Li (birth and death dates unknown), courtesy name Gongyuan, was an official of the state of Shu Han during the Three Kingdoms period of China.@en', 6),
	(7516, 'Brad Cathers is a Canadian politician. He represents the electoral district of Lake Laberge in the Yukon Legislative Assembly on behalf of the Yukon Party. He is currently the longest-serving incumbent in the Assembly.@en', 5),
	(7517, '@en', 4),
	(7518, 'Sheikh Nahyan bin Mubarak Al Nahyan (Arabic: ????? ????? ?? ????? ?? ??????? / English: Nahayan bin Mabarak Al Nahayan) heads the United Arab Emirates Ministry of Culture, Youth, and Social Development.@en', 4),
	(7519, 'Suzanne \\"Shannie\\" Duff, CM is a Canadian politician, who has served as mayor of St. John\'s, Newfoundland and Labrador and as a member of the Newfoundland and Labrador House of Assembly.@en', 4),
	(7520, 'Ayoub Tabet (1884 - 1947) (Arabic:???? ????) was a Lebanese Protestant politician.@en', 4),
	(7521, 'Ambassador Ersin Erçin is a senior Turkish diplomat, with an extensive experience in multilateral diplomacy particularly on matters of international, Euro-Atlantic and Eurasian security, disarmament, and economic and environmental security. He currently serves as Turkish President Abdullah Gül’s Special Envoy for European Security.@en', 4),
	(7522, 'Joseph C. Casdin was a three-term mayor of Worcester, Massachusetts, and the city\'s first Jewish mayor.@en', 4),
	(7523, 'Cheng Pu (died after 210 CE), courtesy name Demou, was a military general serving under the warlord Sun Quan in the late Eastern Han dynasty. He previously served under Sun Quan\'s predecessors: Sun Jian (Sun Quan\'s father) and Sun Ce (Sun Quan\'s elder brother).@en', 4),
	(7524, 'Eric Fairclough is a Canadian politician, who represented the electoral district of Mayo-Tatchun in the Yukon Legislative Assembly from 1996 to 2011.Originally a member of the Yukon New Democratic Party as well as the party\'s leader from 2001 to 2002, Fairclough quit the party in 2006 after approaching the Yukon Liberal Party. He sat as a Liberal MLA for the remainder of his time in the legislature.Fairclough was formerly a Chief of the Little Salmon/Carmacks First Nation.@en', 4),
	(7525, 'Eric Fairclough is a Canadian politician, who was a Cabinet minister and Leader of the Official Opposition in the Yukon Legislative Assembly. He represented the rural Yukon electoral district of Mayo-Tatchun in the Yukon Legislative Assembly from 1996 to 2011 under both the Yukon New Democratic Party and the Liberals. He is also a former Chief of the Little Salmon/Carmacks First Nation.@en', 4),
	(7526, 'Lin Hatfield Dodds (born Linda Hatfield), Australian social policy expert and former Churchill Fellow, is the Deputy Secretary for Social Policy in the Department of Prime Minister and Cabinet, and former National Director of UnitingCare Australia and Chair of the Australian Social Inclusion Board.@en', 4),
	(7527, 'Sheikh Nahyan bin Mubarak Al Nahyan heads the United Arab Emirates Ministry of Culture, Youth, and Social Development.@en', 4),
	(7528, 'Kep Chuktema (Khmer: ??? ??????) is the former governor and mayor of the Municipality of Phnom Penh.@en', 4),
	(7529, 'Ali Asghar Khan (Urdu: ??? ???? ????;) is a prominent politician and social activist from the Hazara region of Pakistan. He lives in Abbottabad, the centre of the Hazara region in Khyber Pakhtunkhwa.@en', 4),
	(7530, 'Fawzia Peer is currently serving as the Deputy Mayor of the eThekwini Metropolitan Municipality .@en', 4),
	(7531, 'Cai Mao (birth and death years unknown), courtesy name Degui, was a military officer serving under the warlords Liu Biao and Cao Cao in the late Eastern Han dynasty.@en', 4),
	(7532, 'Lin Hatfield Dodds (born Linda Hatfield), Australian social policy expert and former Churchill Fellow, is National Director of UnitingCare Australia and Chair of the Australian Social Inclusion Board.@en', 4),
	(7533, 'Ali Asghar Khan (Urdu: ??? ???? ?????;) is a prominent politician and social activist from the Hazara region of Pakistan. He lives in Abbottabad, the centre of the Hazara region in Khyber Pakhtunkhwa.@en', 4),
	(7534, 'Sunil Shastri is an Indian politician and a former cabinet minister in the Government of Uttar Pradesh. Before joining politics, he served the Bank of India as an Officer in different capacities for fourteen years. He was also elected to Uttar Pradesh Legislative Assembly from Gorakhpur assembly constituency as INC candidate.@en', 4),
	(7535, 'H.E. Aung Maung is the mayor ofMyanmar\'s second largest city, Mandalay. He was concurrently appointed as Mandalay\'s mayor of Mandalay and chairman of the Mandalay City Development Committee. He is also the minister for the ministry of Developing of the Mandalay Region.President:Thein SeinPrime minister:Ye MyintPreceded by Phone Zaw HanSucceeded by Ye Lwin.@en', 3),
	(7536, 'Liu Ye (died 234), courtesy name Ziyang, was an adviser to the warlord Cao Cao in the late Eastern Han dynasty. After the fall of the Han dynasty, he served as an official in the state of Cao Wei during the Three Kingdoms period. He was a member of the House of Liu, the imperial clan of the Han dynasty, and a direct descendant of Emperor Guangwu. He had two sons: Liu Yu (??) and Liu Tao (??).@en', 3),
	(7537, 'Huan Jie (birth and death dates unknown), courtesy name Boxu, was an official who lived in the late Eastern Han dynasty. He served in the state of Cao Wei during the Three Kingdoms period after the end of the Han dynasty.@en', 3),
	(7538, 'Mohammad Ali Foroughi (1 January 1875 – 26 November 1942, Persian: ??????? ??????) also known as Zaka-ol-Molk (Persian: ???????????) was a teacher, diplomat, nationalist, writer, politician and Prime Minister of Iran.@en', 3),
	(7539, 'Abdulkadir Abdinur Hashi (Somali: Cabdulqaadir C/nuur Xaashi, Arabic: ??? ?????? ???????? ?????) is a Somali politician. He previously served as the Minister of State for Planning and International Cooperation of Puntland, and is a Member of the Federal Parliament of Somalia.@en', 3),
	(7540, 'Douglas William Domenech is an American government official and the current Assistant United States Secretary of the Interior for Insular Areas. He is the former Deputy Chief of Staff of the United States Department of the Interior, Senior Advisor to the Secretary of the Interior, and a George W. Bush administration appointee to the White House Working Group on the Political Status of Puerto Rico.@en', 3),
	(7541, 'Li Ru (birth and death dates unknown), courtesy name Wenyou, was an official serving under the warlord Dong Zhuo in the Eastern Han dynasty.@en', 3),
	(7542, 'Gut Good Skrub@en', 3),
	(7543, 'Mom Rajawongse Seni Pramoj (May 26, 1905 – July 28, 1997) (Thai: ?????????????????? ??????, rtgs: Seni Pramot, pronunciation:  [s??.ni? pra?.mô?t]) was three times the prime minister of Thailand and a politician in the Democrat Party. A member of the Thai royal family, he was the great-grandson of King Rama II.@en', 3),
	(7544, 'Li Tong (168–209), courtesy name Wenda, was a military general serving under the warlord Cao Cao in the late Eastern Han dynasty. Li Tong came to serve Cao Cao when the latter was at war with rival warlords Liu Biao and Zhang Xiu. During the battle of Battle of Nan Commandery in 208, Li Tong broke through the defence lines guarded by Guan Yu and supported Cao Ren at Jiangling. He fell sick during this time and eventually succumbed to illness. He had two sons: Li Xu (??) and Li Ji (??).@en', 3),
	(7545, 'Ahmed Elmi Osman \\"Karaash\\" (Somali: Axmed Cilmi Cismaan, Arabic: ???? ????? ?????) is a Somali politician. He has served as the Minister of Aviation of Puntland, and as one of the presidents of the Khatumo State administration in northern Somalia. Osman is the Minister of Interior of Puntland.@en', 3),
	(7546, 'George Marston was a lawyer who served in various political offices, including as the Attorney General of Massachusetts.@en', 3),
	(7547, 'Heather Keith, formerly known as Heather Keith-Ryan, is an anglophone rights activist from the Eastern Townships region of the Canadian province of Quebec. She has served two terms as president of the Townshippers\' Association and in this capacity has opposed provincial restrictions on the use of the English language. Keith herself is fluent in English and French.@en', 3),
