	(10369, 'Subject\'s popular name (birthdate – death) can be a lead-in to the subject\'s real, formal, or extended name. Describe the subject\'s nationality and profession(s) in which the subject is most notable. Provide a description of the subject\'s major contributions in the immediately relevant field(s) of notable expertise.@en', 13),
	(10370, 'Kamehameha I (Hawaiian pronunciation: [k?meh??m?h?]; c.?1736? – May 8 or 14, 1819 ), also known as Kamehameha the Great, (full Hawaiian name: Kalani Pai?ea Wohi o Kaleikini Keali?ikui Kamehameha o ?Iolani i Kaiwikapu kau?i Ka Liholiho K?nui?kea) was the founder and first ruler of the Kingdom of Hawaii. A statue of him was given to the National Statuary Hall Collection in Washington, D.C. by the state of Hawaii as one of two statues it is entitled to give.@en', 10),
	(10371, 'A list of characters from the RTL Television soap opera Ruža vjetrova.@en', 10),
	(10372, 'Roger Thorpe and Holly Norris are fictional characters and a supercouple from the American CBS daytime drama Guiding Light.@en', 6),
	(10373, 'Babur (Persian: ?????, lit. \'Tiger\'?; 14 February 1483 – 26 December 1530), born ?ah?r-ud-D?n Mu?ammad (Persian: ????????? ??????, Zahir al-Din Muhammad), was a conqueror from Central Asia who, following a series of setbacks, finally succeeded in laying the basis for the Mughal dynasty in the Indian subcontinent and became the first Mughal emperor.@en', 6),
	(10374, 'Hey, it\'s OurMine don\'t worry we are just testing your security , please contact us - contactourmineteam@gmail.comhttps://ourmine.org@en', 6),
	(10375, 'Draupadi (Sanskrit: ???????, Sanskrit pronunciation: [d?r??p?d?i]) is one of the most important female characters in the Hindu epic, Mahabharata. According to the epic, she is the daughter of Drupada, King of Panchala.Draupadi is considered as one of the Panch-Kanyas or Five Virgins.@en', 5),
	(10376, 'Gnaeus Pompeius Magnus (Classical Latin: [?gnae?.?s p?m?p?j.j?s ?ma?.n?s]; 29 September 106 BC – 29 September 48 BC), usually known in English as Pompey /?p?mpi?/ or Pompey the Great, was a military and political leader of the late Roman Republic. He came from a wealthy Italian provincial background, and his father had been the first to establish the family among the Roman nobility.@en', 5),
	(10377, 'Template:About how Jessica and Ashley became the rulers of Rome. Caesar was their daddy. Keen was brother and R.A.J.A became the great powerful leader of Rome. \\"Gnaeus Pompeius\\"Gnaeus Pompeius Magnus (Classical Latin: [?gnae?.?s p?m?p?j.j?s ?ma?.n?s]; 29 September 106 BC – 28 September 48 BC), usually known in English as Pompey /?p?mpi?/ or Pompey the Great, was a military and political leader of the late Roman Republic.@en', 5),
	(10378, 'Saw Omma redirects here. For other people named Saw Omma, see Saw Omma (disambiguation).Saw Omma (Burmese: ????????, pronounced [s?? ò??mà]) was the chief queen consort of four consecutive kings of Pinya and Ava Kingdoms from 1350 to 1367. Descended from Pagan and Myinsaing–Pinya royal lines, the queen was well known for her beauty, and was selected as the chief queen of the last three kings of Pinya: Kyawswa II, Narathu and Uzana II.@en', 5),
	(10379, 'Bo Buchanan is a fictional character from the American soap opera One Life to Live.@en', 5),
	(10380, 'Frederick II (26 December 1194 – 13 December 1250; Sicilian: Fidiricu II, German: Friedrich II) was a Holy Roman Emperor and King of Sicily in the Middle Ages, a member of the House of Hohenstaufen. His political and cultural ambitions, based in Sicily and stretching through Italy to Germany, and even to Jerusalem, were enormous.@en', 4),
	(10381, 'Frederick II (26 December 1194 – 13 December 1250; Sicilian: Fidiricu, German: Friedrich) was a Holy Roman Emperor, King of the Romans, King of Sicily and King of Jerusalem from the Hohenstaufen dynasty during the Middle Ages. His reign saw the Holy Roman Empire reaching its all time territorial peak. His political and cultural ambitions were enormous as he ruled a vast area beginning with Sicily and stretching through Italy all the way north to Germany.@en', 4),
	(10382, 'She was very nice@en', 4),
	(10383, 'Ibrahim (Ottoman Turkish: ????????, Turkish: ?brahim) (5 November 1615 – 18 August 1648) was the Sultan of the Ottoman Empire from 1640 until 1648. He was born in Constantinople the son of Ahmed I by Valide Kösem Sultan, an ethnic Greek originally named Anastasia. He was later called Ibrahim the Mad (Turkish: Deli ?brahim) by twentieth century historians due to his reputed mental condition —probably psychoneurosis.@en', 4),
	(10384, 'Luc Besson (French: [lyk b?s??]; born 18 March 1959) is a French film director, screenwriter, and producer. He directed or produced the films Subway (1985), The Big Blue (1988), and Nikita (1990). Besson is known for his distinctive filmmaking style and is associated with the movement critics call Cinéma du look. He has been nominated for a César Award for Best Director and Best Picture for his films Léon: The Professional and The Messenger: The Story of Joan of Arc.@en', 4),
	(10385, 'Luc Besson (French pronunciation: ?[lyk b?s??]; born 18 March 1959) is a French film director, screenwriter, and producer. He directed or produced the films Subway (1985), The Big Blue (1988), and Nikita (1990), all using a distinctive style dubbed Cinéma du look by critics. Besson has been nominated for a César Award for Best Director and Best Picture for his films Léon: The Professional and The Messenger: The Story of Joan of Arc.@en', 4),
	(10386, 'Carly Snyder (maiden name Tenney; formerly Lowe, Munson, and Dixon) is a fictional character from the CBS soap opera As the World Turns.@en', 4),
	(10387, 'Anita Blake is the title and viewpoint character of the Anita Blake: Vampire Hunter series by Laurell K. Hamilton. The series takes place in a parallel world in which supernatural characters like vampires and werewolves exist alongside regular humans, with Blake\'s jobs including the re-animation of the dead as well as the hunting and executing of supernatural creatures (mostly vampires) that have broken the law.@en', 4),
