	(10442, 'In the Hindu epic Mahabharata, Bhima or Bhimsen (Sanskrit: ???) is the second of the Pandavas. The Mahabharata relates many events which portray the immense might of Bhima. Bhima is responsible for slaying all hundred Kaurava brothers in the Kurukshetra War.@en', 2),
	(10443, 'Maharishi Bhrigu (Sanskrit: Bh?gu) was one of the seven great sages, the Saptarshis, one of the many Prajapatis (the facilitators of Creation) created by [[Brahma] Born in ballia. (The God of Creation), the first compiler of predictive astrology, and also the author of Bhrigu Samhita, the astrological (Jyotish) classic. Bhrigu is considered as a Manasa Putra (mind-born-son) of Brahma. The adjectival form of the name, Bhargava, is used to refer to the descendants and the school of Bhrigu.@en', 2),
