	(11016, 'Kamehameha I (Hawaiian pronunciation: [k?meh??m?h?]; c.?1736? – May 8 or 14, 1819 ), also known as Kamehameha the Great, (full Hawaiian name: Kalani Pai?ea Wohi o Kaleikini Keali?ikui Kamehameha o ?Iolani i Kaiwikapu kau?i Ka Liholiho K?nui?kea) was the founder and first ruler of the Kingdom of Hawaii. A statue of him was given to the National Statuary Hall Collection in Washington, D.C. by the state of Hawaii as one of two statues it is entitled to give.@en', 10),
