	(11020, 'Draupadi (Sanskrit: ???????, Sanskrit pronunciation: [d?r??p?d?i]) is one of the most important female characters in the Hindu epic, Mahabharata. According to the epic, she is the daughter of Drupada, King of Panchala.Draupadi is considered as one of the Panch-Kanyas or Five Virgins.@en', 5),
