	(11029, 'Myauk Pyinthe (Burmese: ?????????????, pronounced [mjau? pjì? ð??] or [mjau? bjì? ð??]; lit. \\"Queen of the Northern Palace\\") was a queen consort of three kings of Pagan, Saw Rahan II, Kunhsaw Kyaunghpyu and Sokkate, and the mother of King Anawrahta, the founder of the Pagan Empire.@en', 3),
	(11030, '.@en', 3),
	(11031, 'This is a list of characters from the police procedural British television series, The Bill. The fictional characters displayed here are ordered alphabetically by character surname. For a full list of current characters ordered by rank, see list of The Bill characters. The characters are all police officers or civil support staff operating from the fictional Sun Hill Police Station within the London borough of Canley, London.@en', 3),
	(11032, 'Denise Nicholas (born Donna Denise Nicholas; July 12, 1944) is an African-American actress and social activist who was involved in the Civil Rights Movement. She is known primarily for her role as high school guidance counselor Liz McIntyre on the ABC comedy-drama series Room 222, and for her role as Councilwoman Harriet DeLong on the NBC/CBS drama series In the Heat of the Night.@en', 3),
	(11033, 'He\'s a terrible artist who is the living version of Satan@en', 3),
	(11034, 'Vivian Alamain is a fictional character from the American NBC soap opera Days of Our Lives, played by Louise Sorel.@en', 3),
	(11035, 'Lady Catherine Gordon (c.?1474–October 1537) was a Scottish noblewoman and the wife of Yorkist pretender, Perkin Warbeck /Richard Duke Of York. After her imprisonment by King Henry VII of England, she became a favoured lady-in-waiting of his wife, Elizabeth of York. She had a total of four husbands, but there are no records she had any surviving children.@en', 3),
	(11036, 'Marius de Romanus is a fictional character in The Vampire Chronicles novels written by Anne Rice. He is the primary character in the novel Blood and Gold.@en', 3),
	(11037, 'William Orville \\"Bill\\" Henrickson is a fictional character in the HBO series Big Love, portrayed by Bill Paxton. The protagonist of the series, he is the head of a polygamous family. He is married to three wives, Barbara Henrickson, Nicolette Grant and Margene Heffman. He has fathered eight children with these three women.@en', 3),
	(11038, 'Margene \\"Margie\\" Heffman is a character on Big Love, the fictional HBO television series set among contemporary polygamists in Utah. The role is played by Ginnifer Goodwin. The show focuses on the family of Bill Henrickson; Margene is the third of Henrickson\'s three wives, and the biological mother of three of Henrickson\'s children: Aaron, Lester, and Nell.@en', 3),
	(11039, 'Nicolette Eugenia \\"Nicki\\" Grant is a character in Big Love, the HBO television series set among contemporary polygamists in Utah. The role is played by Chloë Sevigny. The show focuses on the family of Bill Henrickson; Nicki is the second of Henrickson\'s three wives, and the biological mother to two of Henrickson\'s children, Wayne and Raymond.@en', 3),
	(11040, 'Joey Buchanan is a fictional character from the American daytime serial One Life to Live. The character is the son of original protagonists Victoria Lord and Joe Riley, Sr.@en', 3),
	(11041, 'Denise Nicholas (born Donna Denise Nicholas; July 12, 1944) is an American actress and social activist who was involved in the Civil Rights Movement. She is known primarily for her role as high school guidance counselor Liz McIntyre on the ABC comedy-drama series Room 222, and for her role as Councilwoman Harriet DeLong on the NBC/CBS drama series In the Heat of the Night.@en', 3),
	(11042, 'Donna Denise Nicholas (born July 12, 1944) is an American actress and social activist who was involved in the Civil Rights Movement. She is known primarily for her role as high-school guidance counselor Liz McIntyre on the ABC comedy-drama series Room 222, and for her role as Councilwoman Harriet DeLong on the NBC/CBS drama series In the Heat of the Night.@en', 3),
	(11043, 'Frederick I (German: Friedrich I.) (11 July 1657 – 25 February 1713), of the Hohenzollern dynasty, was (as Frederick III) Elector of Brandenburg (1688–1713) and Duke of Prussia in personal union (Brandenburg-Prussia). The latter function he upgraded to royalty, becoming the first King in Prussia (1701–1713). From 1707 he was in personal union the sovereign prince of the Principality of Neuchâtel (German: Fürstentum Neuenburg). He was also the paternal grandfather of Frederick the Great.@en', 3),
