	(11052, 'K?nekap?lei was a Hawaiian High Chiefess, wife of Kalani??pu?u and the aunt of Kamehameha I. She was present at the time of Captain Cook\'s death, calling attention to the kidnapping of her husband by Cook and his sailors. A group of men from among those attracted to the beach to answer her calls for help grabbed Cook and stabbed him to death.@en', 2),
	(11053, 'In the Hindu epic Mahabharata, Bhima or Bhimsen (Sanskrit: ???) is the second of the Pandavas. The Mahabharata relates many events which portray the immense might of Bhima. Bhima is responsible for slaying all hundred Kaurava brothers in the Kurukshetra War.@en', 2),
