	(11078, 'Alan IV (born circa 1063; died 13 October 1119) was Duke of Brittany from 1084 until his abdication in 1112. He was also Count of Nantes (from c. 1103) and Count of Rennes. His parents were Hawise, Duchess of Brittany and Hoel II. He is also known as Alan Fergant. Through his father, he was of the Breton House of Cornouaille dynasty (Breton: Kerne dynasty). He was the last Breton-speaking Duke of Brittany.@en', 2),
